npDate3=80;               // 3%\ninput int             InpPrice3=75;              // 3%\ninput color           InpColor=clrRed;           // \ninput ENUM_LINE_STYLE InpStyle=STYLE_DASHDOTDOT; // \ninput int             InpWidth=2;                // \ninput bool            InpBack=false;             // \ninput bool            InpSelection=true;         // \ninput bool            InpRayLeft=false;          // \ninput bool            InpRayRight=false;         // \ninput bool            InpHidden=true;            // \ninput long            InpZOrder=0;               // \n//+------------------------------------------------------------------+\n//|                                      |\n//+------------------------------------------------------------------+\nbool FiboExpansionCreate(const long            chart_ID=0,           //  ID\n                         const string          name="FiboExpansion", // \n                         const int             sub_window=0,         // \n                         datetime              time1=0,              // \n                         double                price1=0,             // \n                         datetime              time2=0,              // \n                         double                price2=0,             // \n                         datetime              time3=0,              // \n                         double                price3=0,             // \n                         const color           clr=clrRed,           // \n                         const ENUM_LINE_STYLE style=STYLE_SOLID,    // \n                         const int             width=1,              // \n                         const bool            back=false,           // \n                         const bool            selection=true,       // \n                         const bool            ray_left=false,       // \n                         const bool            ray_right=false,      // \n                         const bool            hidden=true,          // \n                         const long            z_order=0)            // \n  {\n//--- \n   ChangeFiboExpansionEmptyPoints(time1,price1,time2,price2,time3,price3);\n//--- \n   ResetLastError();\n//--- \n   if(!ObjectCreate(chart_ID,name,OBJ_EXPANSION,sub_window,time1,price1,time2,price2,time3,price3))\n     {\n      Print(__FUNCTION__,\n            ": failed to create \\"Fibonacci Extension\\"! Error code = ",GetLastError());\n      return(false);\n     }\n//--- \n   ObjectSetInteger(chart_ID,name,OBJPROP_COLOR,clr);\n//---\n   ObjectSetInteger(chart_ID,name,OBJPROP_STYLE,style);\n//--- \n   ObjectSetInteger(chart_ID,name,OBJPROP_WIDTH,width);\n//---  (false)  (true)\n   ObjectSetInteger(chart_ID,name,OBJPROP_BACK,back);\n//---  (true)  (false) \n//--- ObjectCreate\n//--- \n//--- true \n   ObjectSetInteger(chart_ID,name,OBJPROP_SELECTABLE,selection);\n   ObjectSetInteger(chart_ID,name,OBJPROP_SELECTED,selection);\n//---  (true)  (false) \n   ObjectSetInteger(chart_ID,name,OBJPROP_RAY_LEFT,ray_left);\n//---  (true)  (false) \n   ObjectSetInteger(chart_ID,name,OBJPROP_RAY_RIGHT,ray_right);\n//--- (true)  (false) \n   ObjectSetInteger(chart_ID,name,OBJPROP_HIDDEN,hidden);\n//--- \n   ObjectSetInteger(chart_ID,name,OBJPROP_ZORDER,z_order);\n//--- \n   return(true);\n  }\n//+------------------------------------------------------------------+\n//|                                                 |\n//+------------------------------------------------------------------+\nbool FiboExpansionLevelsSet(int             levels,               // \n                            double          &values[],            // \n                            color           &colors[],            // \n                            ENUM_LINE_STYLE &styles[],            // \n                            int             &widths[],            // \n                            const long      chart_ID=0,           //  ID\n                            const string    name="FiboExpansion") // \n  {\n//--- \n   if(levels!=ArraySize(colors) || levels!=ArraySize(styles) ||\n      levels!=ArraySize(widths) || levels!=ArraySize(widths))\n     {\n      Print(__FUNCTION__,": array length does not correspond to the number of levels, error!");\n      return(false);\n     }\n//--- \n   ObjectSetInteger(chart_ID,name,OBJPROP_LEVELS,levels);\n//--- \n   for(int i=0;i<levels ;i++)\n     {\n      //--- \n      ObjectSetDouble(chart_ID,name,OBJPROP_LEVELVALUE,i,values[i]);\n      //--- \n      ObjectSetInteger(chart_ID,name,OBJPROP_LEVELCOLOR,i,colors[i]);\n      //--- \n      ObjectSetInteger(chart_ID,name,OBJPROP_LEVELSTYLE,i,styles[i]);\n      //--- \n      ObjectSetInteger(chart_ID,name,OBJPROP_LEVELWIDTH,i,widths[i]);\n      //--- \n      ObjectSetString(chart_ID,name,OBJPROP_LEVELTEXT,i,"FE "+DoubleToString(100*values[i],1));\n     }\n//--- \n   return(true);\n  }\n//+------------------------------------------------------------------+\n//|                                            |\n//+------------------------------------------------------------------+\nbool FiboExpansionPointChange(const long   chart_ID=0,           //  ID\n                              const string name="FiboExpansion", // \n                              const int    point_index=0,        // \n                              datetime     time=0,               // \n                              double       price=0)              // \n  {\n//--- \n   if(!time)\n      time=TimeCurrent();\n   if(!price)\n      price=SymbolInfoDouble(Symbol(),SYMBOL_BID);\n//--- \n   ResetLastError();\n//--- \n   if(!ObjectMove(chart_ID,name,point_index,time,price))\n     {\n      Print(__FUNCTION__,\n            ": failed to move the anchor point! Error code = ",GetLastError());\n      return(false);\n     }\n//--- \n   return(true);\n  }\n//+------------------------------------------------------------------+\n//|                                                   |\n//+---------------------------------------